import MovieDescription from "./Movie";
import { useState } from "react";
import { useNavigate } from "react-router";
import { Box, Heading, Wrap } from "@chakra-ui/react";
import Movie from "./Movie";
import { useSelector } from "react-redux";

const MovieSearch = () => {
  //console.log(movie)
  const movie = useSelector((state) => state.userSearch);
  console.log(movie);

  return (
    <div>
      <h1>estamos en movieSearch</h1>
      <Box marginTop={50} marginLeft={30} marginBottom={50}>
        <Heading marginBottom={30}>The Movie Squad</Heading>
        <Wrap>
          {movie.map((movie) => (
            <Movie key={movie.id} movieCard={movie} />
          ))}
        </Wrap>
      </Box>
      ;
    </div>
  );
};

export default MovieSearch;
